import React,{Component} from 'react';
import {Link} from 'react-router-dom';
import SignedInLinks from './SignedInLinks'
import SignedOutLinks from './SignedOutLinks'
import ProjectIndex from './ProjectIndex'
import axios from 'axios'

    class Navbar extends Component{
        constructor(props){
          super(props)


        this.state={

            project_modules:[
                {}
            ]
            }
        }
        componentDidMount(){
         axios.get('localhost:3000/api/v1/projects')
         .then(data => {
           let res=[]
           data.data.data.map((data) =>{
             res.push({id: data.id , title: data.title, body: data.body, user_id: data.user_id})
             this.setState({project_modules: res})
           })
         })
         .catch(data => {

        })
    }

    render(){

        return(
            <div>
            <nav className="nav-wrapper grey darken-3">
                <div className= "container">
                    <Link to='/' className="brand-logo">Firebase ReactApp</Link>
                    <SignedInLinks/>
                    <SignedOutLinks/>
                </div>
            </nav>
            <ProjectIndex project_modules={this.state.project_modules}/>

            </div>
        )
    }
}
export default Navbar
